import React from "react";
import "./Header.css";
import punklogo from "../assets/header/cryptopunk-logo.png";

const Header = () => {
  return (
    <div className="header">
      <div className="logo">
        <img src="../assets/header/cryptopunk-logo.png" alt="punk_logo" />
      </div>
    </div>
  );
};

export default Header;
